import React from "react"
import Head from "./Head.js"
import Butshow from "./Butshow.js"
import 'bootstrap/dist/css/bootstrap.min.css';
import "./style.css"
import { Collapse } from "react-bootstrap";

class App extends React.Component {
  constructor(props){
    super(props)
    this.state={
      homemenustart:false,
      homemenu:false
    }
  }
  sethomemenu(event){
    this.setState({homemenustart:event})
    this.setState({homemenut:!event})
  }
  render() {
    return (   
      <div >
        <Head/><br/>
        <Collapse in={!this.state.homemenustart}>
          <button 
            onClick={()=>this.sethomemenu(!this.state.homemenustart)}
            className="menustartcss"
            >start
          </button>
        </Collapse>
        <Collapse in={this.state.homemenu}>
          <div className="card"><Butshow/></div>
        </Collapse>
      </div>
    )
  }
}

export default App;
